import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六庚日辛巳时断</p><p>六庚日生时辛巳，偏官合刃自身生；</p><p>为人刚毅妻财损，运到金乡贵禄享。</p><p>庚日辛巳时，阳刃偏官。</p><p>庚以辛为刃，丙为杀。</p><p>明辛暗丙，合煞为权。</p><p>通身旺月，贵；不通，无贵，寿考。</p><p>庚子日辛巳时，春富；夏、秋贵；冬贫。</p><p>辰戌丑未年月，印绶，行西南运，贵。</p><p>庚寅日辛巳时，巳酉丑月，身旺，贵。</p><p>煞旺身弱月，贫。</p><p>纯申年月，大贵悠久。</p><p>亥月，东南运、主有权贵。</p><p>庚辰日辛巳时，巳酉丑月，身旺，贵。</p><p>煞旺身弱月，贫。</p><p>纯申年月，大贵悠久。</p><p>亥月，东南运、主有权贵。</p><p>庚辰日辛巳时，终蹇。</p><p>年月不见财，高。</p><p>通木气，行西南运；未申，东北运，俱贵。</p><p>一云先无后有。</p><p>庚午日辛巳时，巳午卯年月，进士风宪。</p><p>巳申酉戌，行土木运，侯伯。</p><p>庚申日辛巳时，刑。</p><p>巳酉丑月，特达。</p><p>春夏，木火旺，财官得地，吉。</p><p>辰戌丑未，印绶，行南运，贵。</p><p>庚戌日辛巳时，年月遇财，吉。</p><p>午未，行东南运，文职操权，恐无好终。</p><p>寅申、翰林宰辅；若行火运，亦难善终。</p><p>庚日相逢时已生，为人福禄依稀平；刑冲破害柱如有，自立自成免祸惊。</p><p>庚日时临辛巳，败财暗鬼偷寻。</p><p>财去财来小人侵，祖父家基难荫。</p><p>外合重行发福，兄弟雁行无音。</p><p>妻迟子晚喜开心，先苦后荣之命。</p>",35),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","244卷 九·六庚日辛巳时断.html.vue"]]);export{f as default};
